import React, { useState, useEffect } from 'react';
import {
  View, Text, StyleSheet, ScrollView, TouchableOpacity, TextInput, Alert, Image, Platform
} from 'react-native';
import Icon from 'react-native-vector-icons/MaterialIcons';
import * as ImagePicker from 'expo-image-picker';
import axios from 'axios';

const NewAnalysisScreen = ({ navigation }) => {
  const [patients, setPatients] = useState([]);
  const [selectedPatient, setSelectedPatient] = useState(null);
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [symptoms, setSymptoms] = useState('');
  const [images, setImages] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    loadPatients();
    requestPermissions();
  }, []);

  const requestPermissions = async () => {
    if (Platform.OS !== 'web') {
      const { status } = await ImagePicker.requestMediaLibraryPermissionsAsync();
      if (status !== 'granted') {
        Alert.alert('Erro', 'Permissão para acessar galeria negada');
      }
    }
  };

  const loadPatients = async () => {
    try {
      const response = await axios.get('/patients');
      setPatients(response.data);
    } catch (error) {
      Alert.alert('Erro', 'Erro ao carregar pacientes');
    }
  };

  const pickImage = async () => {
    try {
      const result = await ImagePicker.launchImageLibraryAsync({
        mediaTypes: ImagePicker.MediaTypeOptions.Images,
        allowsMultipleSelection: true,
        quality: 0.8,
      });

      if (!result.canceled) {
        setImages(prev => [...prev, ...result.assets]);
      }
    } catch (error) {
      Alert.alert('Erro', 'Erro ao selecionar imagem');
    }
  };

  const takePhoto = async () => {
    try {
      const result = await ImagePicker.launchCameraAsync({
        allowsEditing: true,
        aspect: [1, 1],
        quality: 0.8,
      });

      if (!result.canceled) {
        setImages(prev => [...prev, ...result.assets]);
      }
    } catch (error) {
      Alert.alert('Erro', 'Erro ao capturar foto');
    }
  };

  const removeImage = (index) => {
    setImages(prev => prev.filter((_, i) => i !== index));
  };

  const submitAnalysis = async () => {
    if (!selectedPatient || !title) {
      Alert.alert('Erro', 'Selecione um paciente e preencha o título');
      return;
    }

    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('patientId', selectedPatient.id);
      formData.append('title', title);
      formData.append('description', description);
      formData.append('symptoms', symptoms);

      images.forEach((image, index) => {
        formData.append('images', {
          uri: image.uri,
          type: image.type || 'image/jpeg',
          name: image.fileName || `image_${index}.jpg`,
        });
      });

      const response = await axios.post('/analysis', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });

      Alert.alert('Sucesso', 'Análise enviada com sucesso!', [
        { text: 'OK', onPress: () => navigation.goBack() }
      ]);
    } catch (error) {
      Alert.alert('Erro', error.response?.data?.error || 'Erro ao enviar análise');
    } finally {
      setLoading(false);
    }
  };

  return (
    <ScrollView style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()}>
          <Icon name="arrow-back" size={24} color="#1E3A8A" />
        </TouchableOpacity>
        <Text style={styles.headerTitle}>Nova Análise</Text>
      </View>

      <View style={styles.section}>
        <Text style={styles.label}>Selecionar Paciente</Text>
        <ScrollView horizontal showsHorizontalScrollIndicator={false}>
          {patients.map((patient) => (
            <TouchableOpacity
              key={patient.id}
              style={[styles.patientCard, selectedPatient?.id === patient.id && styles.selectedPatientCard]}
              onPress={() => setSelectedPatient(patient)}
            >
              <Icon name="person" size={24} color="#6B7280" />
              <Text style={styles.patientName}>{patient.name}</Text>
            </TouchableOpacity>
          ))}
        </ScrollView>
      </View>

      <View style={styles.section}>
        <Text style={styles.label}>Título da Análise</Text>
        <TextInput style={styles.input} value={title} onChangeText={setTitle} placeholder="Ex: Possível Placa Psoriásica" />

        <Text style={styles.label}>Descrição</Text>
        <TextInput style={[styles.input, styles.textArea]} value={description} onChangeText={setDescription} placeholder="Descreva os detalhes do caso..." multiline numberOfLines={4} />

        <Text style={styles.label}>Sintomas</Text>
        <TextInput style={[styles.input, styles.textArea]} value={symptoms} onChangeText={setSymptoms} placeholder="Liste os sintomas observados..." multiline numberOfLines={3} />
      </View>

      <View style={styles.section}>
        <Text style={styles.label}>Capturar Imagem</Text>

        <View style={styles.imageButtons}>
          <TouchableOpacity style={styles.imageButton} onPress={takePhoto}>
            <Icon name="camera-alt" size={24} color="#1E3A8A" />
            <Text style={styles.imageButtonText}>Tirar Foto</Text>
          </TouchableOpacity>

          <TouchableOpacity style={styles.imageButton} onPress={pickImage}>
            <Icon name="photo-library" size={24} color="#1E3A8A" />
            <Text style={styles.imageButtonText}>Galeria</Text>
          </TouchableOpacity>
        </View>

        {images.length > 0 && (
          <ScrollView horizontal style={styles.imagePreview}>
            {images.map((image, index) => (
              <View key={index} style={styles.imageContainer}>
                <Image source={{ uri: image.uri }} style={styles.previewImage} />
                <TouchableOpacity style={styles.removeImageButton} onPress={() => removeImage(index)}>
                  <Icon name="close" size={16} color="white" />
                </TouchableOpacity>
              </View>
            ))}
          </ScrollView>
        )}
      </View>

      <TouchableOpacity style={[styles.submitButton, loading && styles.disabledButton]} onPress={submitAnalysis} disabled={loading}>
        <Text style={styles.submitButtonText}>{loading ? 'Enviando Análise para EYA...' : 'Enviar Análise para EYA'}</Text>
      </TouchableOpacity>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1, backgroundColor: '#F9FAFB' },
  header: { flexDirection: 'row', alignItems: 'center', padding: 20, backgroundColor: 'white', borderBottomWidth: 1, borderBottomColor: '#E5E7EB' },
  headerTitle: { fontSize: 18, fontWeight: '600', color: '#1F2937', marginLeft: 16 },
  section: { padding: 20 },
  label: { fontSize: 14, fontWeight: '600', color: '#374151', marginBottom: 8 },
  patientCard: { backgroundColor: 'white', borderRadius: 12, padding: 16, marginRight: 12, minWidth: 120, alignItems: 'center', borderWidth: 1, borderColor: '#E5E7EB' },
  selectedPatientCard: { borderColor: '#1E3A8A', borderWidth: 2 },
  patientName: { fontSize: 12, color: '#374151', marginTop: 8, textAlign: 'center' },
  input: { borderWidth: 1, borderColor: '#D1D5DB', borderRadius: 8, padding: 16, fontSize: 16, marginBottom: 16, backgroundColor: 'white' },
  textArea: { height: 100, textAlignVertical: 'top' },
  imageButtons: { flexDirection: 'row', justifyContent: 'space-around', marginBottom: 16 },
  imageButton: { backgroundColor: 'white', borderRadius: 12, padding: 16, alignItems: 'center', borderWidth: 1, borderColor: '#E5E7EB', width: '45%' },
  imageButtonText: { fontSize: 12, color: '#374151', marginTop: 8 },
  imagePreview: { marginTop: 16 },
  imageContainer: { position: 'relative', marginRight: 12 },
  previewImage: { width: 80, height: 80, borderRadius: 8 },
  removeImageButton: { position: 'absolute', top: -8, right: -8, backgroundColor: '#EF4444', borderRadius: 12, width: 24, height: 24, alignItems: 'center', justifyContent: 'center' },
  submitButton: { backgroundColor: '#1E3A8A', borderRadius: 12, padding: 16, alignItems: 'center', margin: 20 },
  submitButtonText: { color: 'white', fontSize: 16, fontWeight: '600' },
  disabledButton: { backgroundColor: '#9CA3AF' }
});

export default NewAnalysisScreen;
